(2, 'bank', '银行汇款/转帐', '0', '银行名称\r\n收款人信息：全称 ××× ；帐号或地址 ××× ；开户行 ×××。\r\n注意事项：办理电汇时，请在电汇单“汇款用途”一栏处注明您的订单号。', 0, 'a:0:{}', 1, 0, 0),
(3, 'alipay', '<font color="#FF0000">支付宝</font>', '0', '支付宝网站(www.alipay.com) 是国内先进的网上支付平台。<br/>支付宝收款接口：在线即可开通，<font color="red"><b>零预付，免年费</b></font>，单笔阶梯费率，无流量限制。<br/><a href="http://cloud.ecshop.com/payment_apply.php?mod=alipay" target="_blank"><font color="red">立即在线申请</font></a>', 0, 'a:4:{i:0;a:3:{s:4:"name";s:14:"alipay_account";s:4:"type";s:4:"text";s:5:"value";s:0:"";}i:1;a:3:{s:4:"name";s:10:"alipay_key";s:4:"type";s:4:"text";s:5:"value";s:0:"";}i:2;a:3:{s:4:"name";s:14:"alipay_partner";s:4:"type";s:4:"text";s:5:"value";s:0:"";}i:3;a:3:{s:4:"name";s:17:"alipay_pay_method";s:4:"type";s:6:"select";s:5:"value";s:1:"0";}}', 1, 0, 1),
(4, 'syl', '<font color="#FF0000">银联电子支付</font>', '0', '中国银联倾力打造的互联网支付平台，安全、高效、便捷。产品分为无卡支付与B2C支付，无卡支付无需持卡人开通网银。产品展示参照铁道部网站www.12306.cn使用之支付方式“中国银联”选项。银联电子支付与商派合作期间，推广期对商派商户<font color="red">免平台接入费</font>，B2C支付接口<font color="red">手续费0.6%</font>，无卡支付接口<font color="red">手续费0.7%</font>，<a href="http://cloud.ecshop.com/payment_apply.php?mod=syl"><font color="red">点击申请</font></a>。', 0, 'a:1:{i:0;a:3:{s:4:"name";s:11:"syl_merAbbr";s:4:"type";s:4:"text";s:5:"value";s:0:"";}}', 1, 0, 1);
