INSERT INTO `slb_touch_article` (`article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description`) VALUES
(6, -1, '用户协议', '', '', '', '', 1, 1456794871, '', 0, '', NULL),
(7, 3, '搜来宝  跨境电商平台', '&lt;p&gt;搜来宝跨境电商致力于打造跨境直邮第一品牌&lt;/p&gt;&lt;p&gt;&lt;img title=&quot;1460171686265247.png&quot; alt=&quot;65593adcf43eb0a833267f9fb608d837.png&quot; src=&quot;http://192.168.0.2/solaibao/code/mobile/data/attached/image/20160409/1460171686265247.png&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;&lt;strong style=&quot;BORDER-LEFT-WIDTH: 0px; FONT-SIZE: 14px; BORDER-RIGHT-WIDTH: 0px; BORDER-BOTTOM-WIDTH: 0px; FONT-WEIGHT: bold; PADDING-BOTTOM: 0px; PADDING-TOP: 0px; PADDING-LEFT: 0px; MARGIN: 0px; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; border-image: none&quot;&gt;琅琊跨境电商榜排名&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　目前我个人认为的跨境电商琅琊榜排名（天猫和京东不算，只算纯跨境电商，包括唯品会和贝贝网主要GMV都是国内业务为主，姑且排除在外）&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　蜜芽，母婴垂直第一&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　聚美，美妆垂直第一&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　考拉， 百货类第一&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　小红书，社交跨境电商第一&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　什么值得买，导购类门户第一&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　洋码头，C2C买手制第一&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　跨境电商商业模式有很多，还有一些类似么么嗖，达令，波罗蜜等，这些由于体量和估值以及市场份额暂时没有办法和以上的相比所以暂时未上榜。&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　&lt;strong style=&quot;BORDER-LEFT-WIDTH: 0px; FONT-SIZE: 14px; BORDER-RIGHT-WIDTH: 0px; BORDER-BOTTOM-WIDTH: 0px; FONT-WEIGHT: bold; PADDING-BOTTOM: 0px; PADDING-TOP: 0px; PADDING-LEFT: 0px; MARGIN: 0px; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; border-image: none&quot;&gt;考拉&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　网易重点项目，倾尽集团资源以及金钱，sku丰富度以及拿仓能力是同类型的无法相比的。哪怕京东国际也无法与网易的自营规模媲美。当之无愧自营业务百货类第一。&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　考拉的优势很明显，弱点其实是所有自营电商都有的问题。&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　供应链过重，反应慢&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　自营过于依赖于现金，导致SKU要多，必然钱也要砸得多。&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　业务过于依赖国内保税仓储，一旦爆仓会导致所有业务停滞，未来可能需要考虑海外仓＋直邮&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　从网站和app来看基本是传统电商1.0货架模式，不过近期看到考拉app开始改版，商品也开始说故事了，开始注重内容运营了。&lt;/p&gt;&lt;p style=&quot;BORDER-LEFT-WIDTH: 0px; BORDER-RIGHT-WIDTH: 0px; WHITE-SPACE: normal; BORDER-BOTTOM-WIDTH: 0px; WORD-SPACING: 0px; TEXT-TRANSFORM: none; COLOR: rgb(51,51,51); PADDING-BOTTOM: 0px; PADDING-TOP: 26px; FONT: 14px/26px 宋体; PADDING-LEFT: 0px; MARGIN: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; BORDER-TOP-WIDTH: 0px; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; border-image: none; -ms-word-wrap: break-word; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px&quot;&gt;　　点评：商品和仓储这种全自营的模式，在品控和物流发货上做到很强大的用户体验，但是这种任性的玩法可能只合适于拥有强大资金和流量的网易了，小创业者不要模仿，蜜淘这种就是先烈，当初做自营的时候我就判断它根本活不下去。&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '', '', 1, 1460069220, '', 0, '', '');
